import { useState } from 'react'
import  Axios  from 'axios'
import './css/register.css'
export default function Register(){
  const [email, setEmail] = useState('')
  const [password, setPassword] = useState('')
  const [nom, setNom] = useState('')
  const [prenom, setPrenom] = useState('')
  const [cpassword, setCPassword] = useState('')

  const [cpasswordVerif, setCPasswordVerif] = useState('')



  const handleChangeEmail = (e) => {
    setEmail(e.target.value)
  }
  const handleChangeNom = (e) => {
    setNom(e.target.value)
  }
  const handleChangePrenom = (e) => {
    setPrenom(e.target.value)
  }
  const handleChangePassword = (e) => {
    setPassword(e.target.value)
  }
  const handleChangeCPassword = (e) => {
    setCPassword(e.target.value)
  }
  const handleChangeVerif = (e) => {
    if (cpassword == password) {
      setCPasswordVerif("Validé")
  }
  else {
    setCPasswordVerif("Votre mot de passe ne correspon pas")
  }
  }
  const sendData = async (e) => {
    e.preventDefault();
        const user = await Axios.post('http://localhost:3333/user/register', 
        {firstname: nom, lastname: prenom, email: email, password: password})
        .then((e) => {
          console.log(e)
        }).catch((error) =>  {
          if (error.response.data.errors[0].field == "password") {
            console.log("Probléme ")

          }
        })
   }

    return (

        <div className="w-full h-screen bg-slate-300 flex flex-row gap-2 p-5 overflow-hidden overflow-y-auto ">
            <div className='w-1/2 h-full flex flex-col justify-center bg-slate-100 z-0 rounded-lg'>
            <p className='font-popone font-bold text-2xl p-5'>TaskManager</p>
  <div className='w-full h-screen my-10 flex flex-col  justify-center items-center' onSubmit={sendData}>
    <form action=""  method='post'  className='w-1/2 flex flex-col gap-5 justify-center items-center'>
    <label htmlFor="nom" className='w-full flex flex-col justify-center items-start'>
        <span className='font-nunito font-bold ml-2'>Nom <span className='text-red-900 font-semibold'>*</span></span>
        <input type="text"  name='firstname' value={nom} onChange={handleChangeNom} className='bg-slate-200 p-2 rounded-2xl w-full font-nunito px-4' placeholder='Entrer votre nom' />
      </label>
    <label htmlFor="prenom" className='w-full flex flex-col justify-center items-start'>
        <span className='font-nunito font-bold ml-2'>Prènom <span className='text-red-900 font-semibold'>*</span></span>
        <input type="text"  name='lastname' value={prenom} onChange={handleChangePrenom} className='bg-slate-200 p-2 rounded-2xl w-full font-nunito px-4' placeholder='Entrer votre prénom' />
      </label>
    <label htmlFor="email" className='w-full flex flex-col justify-center items-start'>
        <span className='font-nunito font-bold ml-2'>Email <span className='text-red-900 font-semibold'>*</span></span>
        <input type="email"  name='email' value={email} onChange={handleChangeEmail} className='bg-slate-200 p-2 rounded-2xl w-full font-nunito px-4' placeholder='Entrer votre email' />
      </label>
    <label htmlFor="password" className='w-full flex flex-col justify-center items-start'>
        <span className='font-nunito font-bold ml-2'>Password <span className='text-red-900 font-semibold'>*</span></span>
        <input type="password" required  name='password' value={password} onChange={handleChangePassword} className='bg-slate-200 p-2 rounded-2xl w-full font-nunito px-4' placeholder='Entrer un mot de passe' />
      </label>
    <label htmlFor="cf-password" className='w-full flex flex-col justify-center items-start '>
        <span className='font-nunito font-bold ml-2'>Confirmer votre mot de passe <span className='text-red-900 font-semibold'>*</span></span>
        <input type="password" required  name='cf-password' value={cpassword} onKeyUp={handleChangeVerif} onChange={handleChangeCPassword} className='bg-slate-200 p-2 rounded-2xl w-full font-nunito px-4' placeholder='Confirmer votre mot de passe' />
         {cpasswordVerif == "" ? "" : cpasswordVerif == "validé" ? <span className='text-green-700'> {cpasswordVerif}</span> : <span>{cpasswordVerif}</span>}


      </label>
      <div className='w-full'>
        <button className='w-full rounded-xl bg-black text-white font-nunito font-semibold p-3'>S'inscrire</button>
      </div>
        </form>
        </div>
            </div>
            <div className='w-1/2 h-full flex flex-col justify-center back-left bg-cyan-100 z-0 rounded-lg '></div>
        </div>

    )
}
